import React from 'react';
import { FaShoppingCart, FaLeaf } from 'react-icons/fa'; // Importing specific icons

const IconExample = () => {
  return (
    <div>
      <h1>Welcome to Plantify</h1>
      <p>Find your favorite plants <FaLeaf /></p> {/* Adding Leaf icon next to text */}
      <button>
        Add to Cart <FaShoppingCart /> {/* Shopping cart icon in a button */}
      </button>
    </div>
  );
};

export default IconExample;
